query ($id:ID){
    tag(id:$id){
        title
        belongsTo{
            edges{
                node{
                    ... on Movie (sortBy: "view" , order: DESC, perPage:8, page: $page) @paginate{
    pageInfo{
          totalPages
          currentPage 
        } {
                            title
                            id
                            ranking
                            path
                            featuredImage
                            tags{
                                id
                                path
                                }
                    }
                }
            }
        }
        belongsTo{
            edges{
                node{
                    ... on M2021 {
                            title
                            id
                            ranking
                            path
                            featuredImage
                            tags{
                                id
                                path
                                }
                    }
                }
            }
        }
    }
}
